    "2015-01-22T15:57:32.160085",nt"name": "comprehensive-housing-affordability-strategy-chas-2008-2010",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Department of Housing and Urban
    Development (HUD) periodically receives custom tabulations of data from the U.S.
    Census Bureau that are largely not available through standard Census products. These
    data, known as the CHAS data (Comprehensive Housing Affordability Strategy), demonstrate
    the extent of housing problems and housing needs, particularly for low income households.
    The CHAS data are used by local governments to plan how to spend HUD funds, and
    may also be used by HUD to distribute grant funds",nt"license_title": "License
